import React,{Component} from "react";

class Children extends Component {
    constructor(){
        super()
        this.removing = this.removing.bind(this)
    }
    removing(){
        document.querySelector().remove();
    }
    render(){
        return(
        <div className="div_child" onClick={this.removing}>
            {this.props.num}
        </div>
        )
    }
}

export default Children;
